import "./index.less"

export default class HeaderContent extends React.Component{
    render() {
        return (
            <div className="header">
               <div className="header-top">
                   <span>欢迎，</span>
                   <a href="javascript:">退出</a>
               </div>
                <div className="header-bottom"></div>
            </div>
        )
    }
}
